import { useEffect } from "react";
import getInf from "../../hooks/useApi";
import Card from "../Card/Card";
import "./Cards.css";

function Cards(){
    var lista = [1, 1, 1, 1, 1];

    useEffect(() => {
        getInf()
            .then((response) => {
                lista = response.data.entries;
                console.log(lista);
            });
    }, []);

    return (
        <div className="Cards">
      
            {lista.map(function(item, i){
                return (
                    <div className="CardsContainer">
                        <Card titulo="teste" subtitulo="teste" preco="teste"/>
                    </div>
                )
            })}
        </div>
    );
}

export default Cards;
